(15, 'Lavagem detalhada', 130, 'A lavagem detalhada inclui aspiração, limpeza das canaleta dos vidros, descontaminação e proteção dos plásticos internos, detalhamento das saídas de ar, detalhamento nas borrachas internas e externas, pré-lavagem e lavagem com esfregação com luva de microfibra, descontaminação ferrosa das rodas, esfregação detalhada das caixas de roda, descontaminação do pneu e proteção de pintura de 5 meses, etc. ', 'O carro fica mais apresentável, com aspecto de um zero km que acabou de sair da concessionária. Além disso, o efeito é duradouro.', 1, 9, '670ed1dd98a91.jpg', '670ed1dd98d6d.jpg', '670ed1dd98fd8.jpeg', '670ed1dd9920e.jpeg', '670ed1dd99457.jpeg'),
(17, 'Enceramento Técnico', 100, 'O Enceramento Técnico inclui a correção de até 15% dos riscos. Também inclui e aplicação de produtos de acabamento, como a cera, para proteger e realçar a pintura do veículo.', 'O Enceramento Técnico proporciona brilho e proteção de 6 meses, evitando que a pintura queime, e proporcionando hidrorepelencia. ', 1, 10, '670ed2c0f16d7.jpeg', '670ed2c0f19e0.jpeg', '670ed2c0f1c4d.jpg', '670ed2c0f1ea7.jpg', '670ed2c0f20f9.jpeg'),
(18, 'Revitalização dos Plásticos Externos', 30, 'A Revitalização dos Plásticos Externos limpa  profundamente os componentes plásticos externos do seu veículo, removendo impurezas e resíduos ', 'A Revitalização dos Plásticos Externos realça o aspecto dos plásticos e protege eles por até 3 meses, deixando com uma aparência de novo. ', 1, 2, '670ed2367a425.jpg', '670ed2367a6d6.jpg', '670ed2367a912.jpeg', '670ed2367ab59.jpg', '670ed2367adae.jpeg'),
(23, 'Lavagem Convencional', 60, 'A Lavagem Convencional inclui aspiração, limpeza básica nos plásticos internos, limpeza dos pedais, pré-lavagem, e lavagem com luva de microfibra, e limpeza de roda, caixa de roda e pneu.', 'A Lavagem Convencional é uma ótima forma de manter seu carro limpo para o dia a dia, tendo um preço acessível e convencional.', 1, 4, '670ed193bb0c3.jpg', '670ed193bb3dd.jpg', '670ed193bb636.jpg', '670ed193bb8a8.jpeg', '670ed193bbaf1.jpg');

